import "./App.css";
import React from "react";
import { BrowserRouter, Route } from "react-router-dom";
import NavBar from "./navbar";
import Create from "./createFabric";
import ViewStash from "./viewStash";


function App() {

    return (
      <BrowserRouter>
        <div>
          <div className="container" style={{padding: "20px"}}>
            <NavBar />
            <Create />
            <Link to="/ViewStash" component={ViewStash}></Link>
          </div>
        </div>
      </BrowserRouter>
    );
  }

export default App;
